import React, { useState } from "react";
import AddUser from "./component/AddUser";
import UserList from "./component/UserList";
function App() {
  const [userInput, setUserInput] = useState(null);

  const addUserCard = (userItems) => {
    alert(JSON.stringify(userItems));
    setUserInput(userItems);

  };

  return (
    <div>
      <AddUser onAddUserCard={addUserCard} />
      {userInput && <UserList items={userInput}/>}

    </div>
  );
}

export default App;
